// Works out the direction of the arrow
function arrow(compNum, selectedNum) {
    if (compNum < selectedNum) {
        arrow1 = "\u2193"
    }
    else if (compNum > selectedNum) {
        arrow1 = "\u2191"
    }
    else {
        arrow1 = ""
    }
    return " " + arrow1
}

// Removes first word in a string
function removeFirstWord(str) {
    var indexOfSpace = str.indexOf(" ");
    if (indexOfSpace === -1) {
      return '';
    }
    
    return str.substring(indexOfSpace + 1);
  }

